  methods: {
    uploadProfileImageToAwsS3: function uploadProfileImageToAwsS3(e) {
      var _this = this;

      this.isUploadingImage = true;
      var files = event.target.files[0];
      this.$store.dispatch('uploadProfileImageToAwsS3', files).then(function (data) {
        _this.userProfileEditing.imgSrc = data.Location;
        _this.isUploadingImage = false;
      }).catch(function (err) {
        _this.isUploadingImage = false;
      });
    },
    ValidateEmailAddress: function ValidateEmailAddress(email) {
      this.$emit('IsEmailUniqueVal', email);
    }
